export default function Content() {
  // console.log(data);

  return (
    <div className="content-page">
      <div className="content-box">
        <Card />
        <Card />
        <Card />
      </div>
    </div>
  );
}

async function animeData() {
  const res = await fetch(
    "https://api.jikan.moe/v4/anime?q=jujutsu kaisen&sfw"
  );
  const data = await res.json();
  console.log(data);
}

animeData();

function Card() {
  // console.log(image);
  return (
    <div className="content-card">
      <div className="content-card-face">
        <div className="card-face-img-box">
          <img
            className="card-face-img"
            src={"https://cdn.myanimelist.net/images/anime/1171/109222l.jpg"}
            alt="k"
          ></img>
        </div>
        <h2>jujutsu kaisen</h2>
      </div>
    </div>
  );
}

